(168, 'elementor_remote_info_feed_data', 'a:5:{i:0;a:5:{s:5:\"title\";s:47:\"Elementor Sites of the Month — September 2020\";s:7:\"excerpt\";s:325:\"Get ready to see some of the best magazine and blog websites built with Elementor. This month’s showcase explores the top ten magazine or blog websites from our user community, and shows prime examples for how to design your next blog or magazine site, with many unique options for layout, color schemes, motifs, and so on.\";s:7:\"created\";i:1602495962;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:123:\"https://elementor.com/blog/showcase-september-2020/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:36:\"The Complete WordPress Sidebar Guide\";s:7:\"excerpt\";s:150:\"Learn how sidebars can improve your site navigation and help you convert more of your traffic with the aid of the right widgets and good use of space.\";s:7:\"created\";i:1602398496;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:123:\"https://elementor.com/blog/wordpress-sidebar-guide/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:50:\"How to Write a Great Website Brief + Free Template\";s:7:\"excerpt\";s:152:\"A good website design brief is paramount to a successful web design project. Make sure that your project is a success with a well-crafted design brief. \";s:7:\"created\";i:1601540958;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:120:\"https://elementor.com/blog/create-website-brief/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:3;a:5:{s:5:\"title\";s:34:\"Introducing Design System Features\";s:7:\"excerpt\";s:211:\"Elementor 3.0 is finally here, and it brings a whole new way to build sites. Get ready for a special 3-in-1 release that includes: Design System Features, New Theme Builder and major performance improvements.​\";s:7:\"created\";i:1601465340;s:5:\"badge\";s:11:\"New Feature\";s:3:\"url\";s:137:\"https://elementor.com/blog/elementor-3-new-professional-features/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:4;a:5:{s:5:\"title\";s:60:\"WordPress Troubleshooting: Common Errors and How to Fix Them\";s:7:\"excerpt\";s:157:\"Have you come across an error and are unsure how to fix it? Follow this comprehensive guide to the most common WordPress errors and learn how to fix them.​\";s:7:\"created\";i:1601378179;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:132:\"https://elementor.com/blog/troubleshooting-wordpress-errors/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}', 'no'),
