(9, 1, '2020-09-11 15:33:26', '2020-09-11 20:33:26', '<h2>Bienvenido</h2>		\n		<p>Tenemos lo que necesitas</p>		\n										<img src=\"http://localhost/Blog/wp-content/uploads/elementor/thumbs/arreglo5-3-ovbxxyiquttxllsqw3mdrjtifw30j4bbuvrd1q1l14.jpg\" title=\"arreglo5\" alt=\"arreglo5\" />											\n		<p>Arreglos florales</p><p>los Arreglos florales son composiciones realizadas con diferentes productos de arte floral</p>		\n			<a href=\"#\" role=\"button\">\n						Read More\n					</a>\n										<img src=\"http://localhost/Blog/wp-content/uploads/elementor/thumbs/bonsais-ovc0ttoq1s0kiexedzwaac95io5532nk4yww4g1hh4.jpg\" title=\"bonsais\" alt=\"bonsais\" />											\n		<p>Bonsais</p><p>El arte del bonsai se origino en Cina hace como unos dos mil años ,es conocido como objeto de culto para los monjes</p>		\n			<a href=\"#\" role=\"button\">\n						Read More\n					</a>\n										<img src=\"http://localhost/Blog/wp-content/uploads/elementor/thumbs/ramos-ovc0u7sawajvckcx3nzotqp2fg7naj7j6wp6blgkvs.jpg\" title=\"ramos\" alt=\"ramos\" />											\n		<p>Ramos</p><p>Los ramos de flores son un conjunto de flores,hierbas y ramas usado principalmente como obsequio</p>		\n			<a href=\"#\" role=\"button\">\n						Read More\n					</a>\n			<h4>¿Quienes somos?</h4>		\n		<p>The Flower Studio te ofrece los mas exclusivos arreglos florales,ramos y bonsais con diversidad de diseños para que elijas el mas optimo para expresar lo que sientes por esa persona especial.</p>		\n			<h4>Nuestros productos</h4>		\n		<p>Aparte de los arreglos florales y ramos de flores nos especializamos principalmente en los bonsais,en el siguiente video se muestran uno de nuestro mejores productos.</p>https://www.youtube.com/watch?v=LjH2Bog4xSI', 'Inicio', '', 'publish', 'closed', 'closed', '', 'inicio', '', '', '2020-09-15 18:34:37', '2020-09-15 23:34:37', '', 0, 'http://localhost/Blog/?page_id=9', 0, 'page', '', 0),
