(122, 1, '2020-09-15 18:33:48', '2020-09-15 23:33:48', '<h2>Bienvenido</h2>		\n		<p>Tenemos lo que necesitas</p>		\n										<img src=\"http://localhost/Blog/wp-content/uploads/elementor/thumbs/arreglo5-3-ovbxxyiquttxllsqw3mdrjtifw30j4bbuvrd1q1l14.jpg\" title=\"arreglo5\" alt=\"arreglo5\" />											\n		<p>Arreglos florales</p><p>los Arreglos florales son composiciones realizadas con diferentes productos de arte floral</p>		\n			<a href=\"#\" role=\"button\">\n						Read More\n					</a>\n										<img src=\"http://localhost/Blog/wp-content/uploads/elementor/thumbs/bonsais-ovc0ttoq1s0kiexedzwaac95io5532nk4yww4g1hh4.jpg\" title=\"bonsais\" alt=\"bonsais\" />											\n		<p>Bonsais</p><p>El arte del bonsai se origino en Cina hace como unos dos mil años ,es conocido como objeto de culto para los monjes</p>		\n			<a href=\"#\" role=\"button\">\n						Read More\n					</a>\n										<img src=\"http://localhost/Blog/wp-content/uploads/elementor/thumbs/ramos-ovc0u7sawajvckcx3nzotqp2fg7naj7j6wp6blgkvs.jpg\" title=\"ramos\" alt=\"ramos\" />											\n		<p>Ramos</p><p>Los ramos de flores son un conjunto de flores,hierbas y ramas usado principalmente como obsequio</p>		\n			<a href=\"#\" role=\"button\">\n						Read More\n					</a>\n			<h4>¿Quienes somos?</h4>		\n		<p>The Flower Studio te ofrece los mas exclusivos arreglos florales,ramos y bonsais con diversidad de diseños para que elijas el mas optimo para expresar lo que sientes por esa persona especial.</p>		\n			<h4>Nuestros productos</h4>		\n		<p>Aparte de los arreglos florales y ramos de flores nos especializamos principalmente en los bonsais,en el siguiente video se muestran uno de nuestro mejores productos.</p>https://www.youtube.com/watch?v=LjH2Bog4xSI', 'Inicio', '', 'inherit', 'closed', 'closed', '', '9-revision-v1', '', '', '2020-09-15 18:33:48', '2020-09-15 23:33:48', '', 9, 'http://localhost/Blog/2020/09/15/9-revision-v1/', 0, 'revision', '', 0),
(123, 1, '2020-09-15 18:35:27', '2020-09-15 23:35:27', '<p>Galeria de arreglos florales</p>		\n			<h3>Nuestro trabajo</h3>		\n										<img width=\"604\" height=\"604\" src=\"http://localhost/Blog/wp-content/uploads/2020/09/arreglo2-1.png\" alt=\"\" loading=\"lazy\" srcset=\"http://localhost/Blog/wp-content/uploads/2020/09/arreglo2-1.png 700w, http://localhost/Blog/wp-content/uploads/2020/09/arreglo2-1-300x300.png 300w, http://localhost/Blog/wp-content/uploads/2020/09/arreglo2-1-150x150.png 150w\" sizes=\"(max-width: 604px) 100vw, 604px\" />											\n										<img width=\"604\" height=\"743\" src=\"http://localhost/Blog/wp-content/uploads/2020/09/arreglo6-2.jpg\" alt=\"\" loading=\"lazy\" srcset=\"http://localhost/Blog/wp-content/uploads/2020/09/arreglo6-2.jpg 736w, http://localhost/Blog/wp-content/uploads/2020/09/arreglo6-2-244x300.jpg 244w\" sizes=\"(max-width: 604px) 100vw, 604px\" />											\n		<p>Realizamos arreglos florales con diseños originales y con variedad de flores que utilizamos para satisfacer tus necesidades</p>		\n										<img width=\"760\" height=\"713\" src=\"http://localhost/Blog/wp-content/uploads/2020/09/arreglo-1.jpg\" alt=\"\" loading=\"lazy\" srcset=\"http://localhost/Blog/wp-content/uploads/2020/09/arreglo-1.jpg 760w, http://localhost/Blog/wp-content/uploads/2020/09/arreglo-1-300x281.jpg 300w\" sizes=\"(max-width: 760px) 100vw, 760px\" />', 'Nosotros', '', 'inherit', 'closed', 'closed', '', '33-revision-v1', '', '', '2020-09-15 18:35:27', '2020-09-15 23:35:27', '', 33, 'http://localhost/Blog/2020/09/15/33-revision-v1/', 0, 'revision', '', 0);
